•
•
Een babymassage is een belangrijke manier van communicatie met je baby. Aanraking is de meest efficiënte manier om liefde voor je kindje te tonen, deze ‘taal’ is intuïtief en zullen zij gelijk begrijpen. Het biedt vertrouwen, geborgenheid en eigenwaarde. Dit is de basis voor een gezonde ontwikkeling van de baby. 
•
•
Uit onderzoek is gebleken dat baby’s die gemasseerd worden een lager cortisol gehalte (het stresshormoon) hebben, en een hoger gehalte aan serotonine; dit resulteert in een prettig, geborgen gevoel en bevordert gevoelens van liefde en verbondenheid.
•
•
De massage werkt niet alleen op de huid, het stimuleert ook andere lichaamssystemen zoals de bloed circulatie, spijsvertering, het ademhalingssysteem en de werking van de nieren. Babymassage kan ook helpen om de spieren en gewrichten beter te kunnen ontspannen en verstevigen. 
•
•
Babymassage heeft tal van voordelen voor de baby (en ouders). Je baby zal zelfverzekerder worden, minder prikkelbaar en angstig zijn. Het is een aanrader om al in de eerste maanden na de geboorte met babymassage te beginnen. Je baby ligt dan nog lekker stil en heeft deze heerlijke koestering echt nodig. En.. je begint meteen goed met het verder opbouwen van jullie goede, liefdevolle band. ❤️
•
•
